import React from "react";
import ReactDom from "react-dom";

const data = [
  {
    title: "Code Coding Computer Data Developing Development",
    image: "https://placedog.net/500/280",
    user: "Nature Code",
    views: "22k",
    published: "9 months",
    avatar: "https://placedog.net/210/167",
  },
  {
    title: "Code Coding Computer Data Developing Development",
    image: "https://placedog.net/500/280",
    user: "Nature Code",
    views: "22k",
    published: "9 months",
    avatar: "https://placedog.net/210/167",
  },
  {
    title: "Code Coding Computer Data Developing Development",
    image: "https://placedog.net/500/280",
    user: "Nature Code",
    views: "22k",
    published: "9 months",
    avatar: "https://placedog.net/210/167",
  },
  {
    title: "Code Coding Computer Data Developing Development",
    image: "https://placedog.net/500/280",
    user: "Nature Code",
    views: "22k",
    published: "9 months",
    avatar: "https://placedog.net/210/167",
  },
];

function VideoList() {
  return (
    <div className="video-grid">
      {data.map((item) => (
        <SingleVideo {...item} />
      ))}
    </div>
  );
}

function SingleVideo({ title, image, user, views, published, avatar }) {
  const dogBark = () => {
    alert(`${user} says WOOF!`);
  };
  return (
    <div className="video-container">
      <div className="video-image" onClick={dogBark}>
        <img src={image} alt={title} />
      </div>
      <div className="video-info-container">
        <div className="user-avatar" onClick={dogBark}>
          <img src={avatar} alt={title} />
        </div>
        <div className="video-info">
          <h4 className="video-title">{title}</h4>
          <h4 className="video-user">{user}</h4>
          <div className="video-stats">
            <span className="video-views">{views} views</span>
            <span className="video-published">{published}</span>
          </div>
        </div>
      </div>
    </div>
  );
}

ReactDom.render(<VideoList />, document.querySelector("#root"));
